import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { ShieldCheck, Lock, Mail, MapPin, ChevronRight } from 'lucide-react';

const CheckoutPage = ({ cart, setCart, user }) => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);
  const [showMomo, setShowMomo] = useState(false);
  const [formData, setFormData] = useState({ email: user?.email || '', phone: '', firstName: '', lastName: '', address: '', city: 'Kigali' });

  const total = cart.reduce((acc, item) => acc + (item.price || 0), 0) + 2000;

  const processOrder = async () => {
    setLoading(true);
    try {
      const { data, error } = await supabase.from('orders').insert([{
        customer_email: formData.email,
        customer_name: `${formData.firstName} ${formData.lastName}`,
        phone_number: formData.phone,
        delivery_address: `${formData.address}, ${formData.city}`,
        total_amount: total,
        payment_status: 'paid',
        order_status: 'processing',
        cart_items: cart
      }]).select();

      if (error) throw error;
      alert(`Order Successful! ID: ${data[0].id}`);
      setCart([]);
      localStorage.removeItem('megaMartCart');
      navigate('/success');
    } catch (err) {
      alert("Error: " + err.message);
    } finally { setLoading(false); }
  };

  return (
    <div style={{ backgroundColor: '#0a0b0b', minHeight: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', padding: '20px' }}>
      {showMomo && (
        <div style={{ position: 'fixed', inset: 0, backgroundColor: 'rgba(0,0,0,0.9)', zIndex: 100, display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
          <div style={{ backgroundColor: 'white', padding: '40px', borderRadius: '24px', textAlign: 'center' }}>
            <h3>Dial to Pay</h3>
            <div style={{ padding: '20px', border: '2px dashed #008ECC', fontSize: '20px', margin: '20px 0', fontWeight: 'bold' }}>*182*8*1*000000#</div>
            <button style={{ width: '100%', padding: '15px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '12px', fontWeight: 'bold' }} onClick={processOrder} disabled={loading}>
              {loading ? "Confirming..." : "I Have Paid"}
            </button>
          </div>
        </div>
      )}
      <div style={{ display: 'flex', width: '900px', backgroundColor: 'white', borderRadius: '24px', overflow: 'hidden' }}>
        <div style={{ flex: 1, padding: '40px' }}>
          <h2 style={{ color: '#111' }}>Checkout</h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '15px', marginTop: '20px' }}>
            <input style={inputStyle} placeholder="Email" value={formData.email} onChange={e => setFormData({...formData, email: e.target.value})} />
            <input style={inputStyle} placeholder="MoMo Phone Number" onChange={e => setFormData({...formData, phone: e.target.value})} />
            <input style={inputStyle} placeholder="Street Address" onChange={e => setFormData({...formData, address: e.target.value})} />
            <button style={payBtn} onClick={() => setShowMomo(true)}>Pay RWF {total.toLocaleString()}</button>
          </div>
        </div>
        <div style={{ flex: 0.8, backgroundColor: '#f9f9f9', padding: '40px' }}>
          <h4>Summary</h4>
          {cart.map((item, i) => (
            <div key={i} style={{ display: 'flex', justifyContent: 'space-between', fontSize: '14px', marginBottom: '10px' }}>
              <span>{item.name}</span>
              <b>RWF {item.price.toLocaleString()}</b>
            </div>
          ))}
          <hr />
          <div style={{ display: 'flex', justifyContent: 'space-between', fontWeight: 'bold', fontSize: '18px' }}>
            <span>Total</span><span>RWF {total.toLocaleString()}</span>
          </div>
        </div>
      </div>
    </div>
  );
};

const inputStyle = { padding: '12px', borderRadius: '8px', border: '1px solid #ddd' };
const payBtn = { padding: '16px', backgroundColor: '#111', color: 'white', borderRadius: '30px', cursor: 'pointer', fontWeight: 'bold', border: 'none' };

export default CheckoutPage;
